var playing = {};
function playMedia(playFollowing)
{
	toggleSeen($("#episodes > .selected > .selected > div > span"), true, true);
	var lastEpisode = playFollowing ? $("#episodes ul.selected li").last().find("div > div").text() : null;
	playing = {"season": currentSeason, "episode": currentEpisode, "element": $("#episodes ul.selected li.selected")};
	app.playMedia(currentMedia.id, currentSeason.key, currentEpisode.key, lastEpisode);
}

function seenNextEpisode(name, index)
{
	if (playing.season === currentSeason)
		toggleSeen($(playing.element.nextAll()[index]).find("div > span"), true, true);
	else
		playing.season.value[name].seen = true;
}

function updateMedia(id, array)
{
	$("#" + id).fadeTo(200, 0, function ()
	{
		$(this).remove();
		currentMedia = null;
		var newMedia = addMedia(id, array);
		newMedia.style.opacity = 0;
		$(newMedia).fadeTo(600, 1);
		sortMediaList();
		newMedia.click();
	});
}

function updateSearch(search)
{
	for (var key in medias) {
		var div = $('#' + key);
		var elt = medias[key];
		if ((elt.info.name.toLowerCase()).indexOf(search) === -1)
			div.fadeOut(200);
		else
			div.fadeIn(200);
	}
}

function filterByType(elt, type)
{
	if (elt.hasClass("selected"))
		return;

	$("html, body").animate({scrollTop: 0}, 500);
	$(".category").removeClass('selected');
	elt.addClass('selected');
	$(mediaList).fadeTo(200, 0, function () {
		for (var key in medias)
		{
			var div = $('#' + key);
			var elt = medias[key];
			if (type === undefined || elt.info.type === type)
				div.show();
			else
				div.hide();
		}
		_setSelection();
		$(mediaList).fadeTo(300, 1);
	});
}

function filterByCategory(genre)
{
	$("html, body").animate({scrollTop: 0}, 500);
	$(mediaList).fadeTo(200, 0, function () {
		for (var key in medias)
		{
			var div = $('#' + key);
			var elt = medias[key];
			var found = false;
			if (genre !== "All")
			{
				if (elt.info.genres !== undefined)
					for (var i = 0; i < elt.info.genres.length; i++)
						if (elt.info.genres[i] === genre)
						{
							div.show();
							found = true;
							break;
						}
				if (!found)
					div.hide();
			}
			else
				div.show();
		}
		_setSelection();
		$(mediaList).fadeTo(300, 1);
	});
}

function removeLocation()
{
	var locToRemove = $($("#locationsList li.hover")[0]);
	var text = locToRemove.text();
	locToRemove.slideUp(300, function () {
		$(this).remove();
	});
	return text;
}

var selection = {"set": false};
function setSelection(id, season, episode)
{
	selection.id = id;
	selection.season = season;
	selection.episode = episode;
	if (id !== null && season !== null && episode !== null)
		selection.set = true;
}

function emptyMediaList()
{
	var tmp = mediaList;
	mediaList = mediaList.cloneNode(true);
	$(mediaList).empty();
	$(tmp).fadeTo(300, 0, function () {
		$(this).empty();
		$(this).replaceWith(mediaList);
		sortMediaList();
		_setSelection();
	});
}

function _setSelection()
{
	if (selection.id === "")
		return;

	var currentSelection = $("#" + selection.id + ":visible");
	if (currentSelection.length > 0)
	{
		currentSelection.click();
		$("html, body").animate({scrollTop: currentSelection.offset().top - 50}, 500);
	}
	else
	{
		currentId = "";
		$(detail).fadeTo(200, 0);
		$("#media-list .selected").removeClass("selected");
	}
}

function dropDownClick(elt, list, noOffset)
{
	hideSelectOptions();
	var pos;
	var position;
	var offset;
	var width = $(elt).width();

	if (noOffset)
	{
		offset = -10;
		pos = $(elt).offset();
		position = "absolute";
	}
	else
	{
		offset = 10;
		pos = $(elt).position();
		position = "fixed";
	}

	$(list).css({
		'left': pos.left + offset,
		'top': pos.top + offset,
		'min-width': width,
		'position': position
	});
	$(list).fadeToggle(200);
	event.stopPropagation();
}

